The Star from the Fairy Tarot Deck by Radleigh Velentine 

The Star - you know you want to change your life, and you are doing things that are setting the wheels in motion, but really, what does your future look like? 
Spend some time and think about what the future you are creating really looks like. Get specific, detail what it feels like to be living the life you desire, what do you do when you wake up in a morning, do you go and workout, then arrange to have lunch with friends. What does it smell like, wearing your ‘favourite, only for special occasions’ perfume/aftershave everyday, what does it taste like, to buy the finest ingredients to cook a beautiful meal or dinning in that restaurant which you have dreamt about. Really feel into what you want your life to be, because right now you have the power to create this life. Once you really know what you want you have the power within you to fulfil your desires, this is now a goal not just a wish. Make it happen! 

Blessings all ✨

This is a general reading, if it doesn’t resonate, then it isn’t for you. 

